#requires -version 5.0

<#
    .SYNOPSIS
        Installs a GPO on the Domain Controllers OU with an immediate task that will register listener to forward event logs to SYSVOL file and a WMI active script consumer to make this listening process persistent.

    .DESCRIPTION
        This command installs (or uninstalls) a GPO which contains a scheduled task for creating an event listener to forward event logs to SYSVOL file and a WMI active script consumer to make this listening process persistent in order to enable Tenable.ad to receive event logs.
        More precisely, its immediate task registers an event listener to receive events logs and write them to a specific file in the SYSVOL, per domain controller. Then it registers a WMI active script consumer to make the above mentionned event listener persistent when a domain controller restarts.
        This command must be run under an administrator Powershell session context or you may also run it under specific user context with Start-Process and runAsUser verb, then fill applicable user and password.
        See examples to see how to install or to uninstall this GPO.

    .PARAMETER GPODisplayName
        The GPO display name to build the task for registering the event listener. By default 'Tenable.ad'.

    .PARAMETER TemporaryFolderLocation
        The temporary folder storing GPO backup during the deployment. By default '%TEMP%\Tenable.ad\'.

    .PARAMETER DomainControllerAddress
        The FQDN name or IP address of the domain controller to deploy to. Please fill it if you run this script from a server or a workstation which is not a domain controller. If not specified, domain information is fetched from the local machine.

    .PARAMETER DomainControllerOU
        The Domain Controller organizational unit distinguished name. Please fill it if you moved out your domain controllers from the default one, e.g 'OU=Domain Controllers,DC=ROOT,DC=DOMAIN'.

    .PARAMETER TenableServiceAccount
        The name of the service account used by Tenable.ad, to explicitly allow it to read the group policy objects.

    .PARAMETER Uninstall
        Uninstalls event listener and WMI active script consumer to stop receiving event logs. By default false.

    .PARAMETER Target
        Specifies the list of domain controllers this registration script is targeting, separated with commas, e.g 'DC-ROOT1,DC-ROOT2'. This parameter is optional.

    .PARAMETER CleaningGPODisplayName
        The cleaning GPO display name to build the task for removing event listener and WMI active script consumer. By default 'Tenable.ad cleaning'.

    .EXAMPLE
        PS> .\Register-TenableIOA.ps1 -TenableServiceAccount Tenable\Administrator
        Installs Tenable.ad GPO to receive event logs. This command uses the only mandatory parameter 'TenableServiceAccount' which is needed to grant a level of permissions for the installed GPO.

    .EXAMPLE
        PS> .\Register-TenableIOA.ps1 -TenableServiceAccount Tenable\Administrator -Target DC-ROOT1,DC-ROOT2
        Installs Tenable.ad GPO to receive event logs, only for domain controllers 'DC-ROOT1' and 'DC-ROOT2'.

    .EXAMPLE
        PS> .\Register-TenableIOA.ps1 -TenableServiceAccount Tenable\Administrator -DomainControllerOU 'OU=Domain Controllers,DC=ROOT,DC=DOMAIN'
        Installs Tenable.ad GPO to receive event logs, for all domain controllers in the 'Domain Controllers' OU.

    .EXAMPLE
        PS> Start-Process powershell.exe -ArgumentList "C:\Register-TenableIOA.ps1", "-TenableServiceAccount", "Tenable\Administrator" -Verb runAsUser
        Installs Tenable.ad GPO with a specific user context, using Start-Process and runAsUser verb.

    .EXAMPLE
        PS> .\Register-TenableIOA.ps1 -Uninstall
        Uninstalls Tenable.ad GPO to stop receiving event logs.

#>
[CmdletBinding(DefaultParametersetName = 'Install')]

Param (
    [Parameter(Mandatory = $False, ParameterSetName = 'Install', HelpMessage = "The GPO display name to build the task for registering event listener and WMI active script consumer. By default 'Tenable.ad'.")]
    [Parameter(Mandatory = $False, ParameterSetName = 'Uninstall', HelpMessage = "The GPO display name to build the task for registering event listener and WMI active script consumer. By default 'Tenable.ad'.")]
    [string]
    $GPODisplayName = 'Tenable.ad',

    [Parameter(Mandatory = $False, ParameterSetName = 'Install', HelpMessage = "The temporary folder storing GPO backup during the deployment. By default '%TEMP%\Tenable.ad\'.")]
    [string]
    $TemporaryFolderLocation = "$((Get-Item $env:TEMP).Fullname)\Tenable.ad\",

    [Parameter(Mandatory = $False, ParameterSetName = 'Install', HelpMessage = "The FQDN name or IP address of the domain controller to deploy to. Please fill it if you run this script from a server or a workstation which is not a domain controller. If not specified, domain information is fetched from the local machine.")]
    [Parameter(Mandatory = $False, ParameterSetName = 'Uninstall', HelpMessage = "The FQDN name or IP address of the domain controller to deploy to. Please fill it if you run this script from a server or a workstation which is not a domain controller. If not specified, domain information is fetched from the local machine.")]
    [string]
    $DomainControllerAddress = "",

    [Parameter(Mandatory = $False, ParameterSetName = 'Install', HelpMessage = "The Domain Controller organizational unit distinguished name. Please fill it if you moved out your domain controllers from the default one, e.g 'OU=Domain Controllers,DC=ROOT,DC=DOMAIN'.")]
    [Parameter(Mandatory = $False, ParameterSetName = 'Uninstall', HelpMessage = "The Domain Controller organizational unit distinguished name. Please fill it if you moved out your domain controllers from the default one, e.g 'OU=Domain Controllers,DC=ROOT,DC=DOMAIN'.")]
    [string]
    $DomainControllerOU = "",

    [Parameter(Mandatory = $True, ParameterSetName = 'Install', HelpMessage = "The name of the service account used by Tenable.ad, to explicitly allow it to read the group policy objects.")]
    [string]
    $TenableServiceAccount,

    [Parameter(Mandatory = $True, ParameterSetName = 'Uninstall', HelpMessage = "Uninstalls event listener and WMI active script consumer to stop receiving event logs. By default false.")]
    [switch]
    $Uninstall = $false,

    [Parameter(Mandatory = $False, ParameterSetName = 'Install', HelpMessage = "The optional list of domain controllers this script is targeting, separated with commas.")]
    [string[]]
    $Target = @(),

    [Parameter(Mandatory = $False, ParameterSetName = 'Install', HelpMessage = "The Cleaning GPO display name to build the task for removing event listener and WMI active script consumer. By default 'Tenable.ad cleaning'.")]
    [Parameter(Mandatory = $False, ParameterSetName = 'Uninstall', HelpMessage = "The Cleaning GPO display name to build the task for removing event listener and WMI active script consumer. By default 'Tenable.ad cleaning'.")]
    [string]
    $CleaningGPODisplayName = 'Tenable.ad cleaning'
)

$global:DomainName = $null
$global:DomainControllerDNSName = $null
$global:DomainControllerOU_DN = $null
$global:DomainControllerIpAddress = $null
$global:AppliedRootAuditCsv = $null
$global:Channels = $null
$global:Attacks = $null
$global:RegistryValuesToSet = $null
$global:PolRegistryValuesToSet = $null
$global:IoaConfiguration = $null

$global:GPODescription = "This GPO has been created as part of the deployment of Tenable.ad"
$global:CleaningGPODescription = "This GPO has been created as part of the cleaning of Tenable.ad"

function Uninstall-ByGpo {
    Write-Host "[-] GPO name to be deployed: $CleaningGPODisplayName"

    # Create an empty GPO to get its GUID
    $cleaningGpo = Get-GPO -Name $CleaningGPODisplayName -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue
    Write-Information "[-] Trying to get existing cleaning GPO: $CleaningGPODisplayName"
    If (-Not $cleaningGpo) {
        Write-Information "[-] Cleaning GPO does not exist, creating new one: $CleaningGPODisplayName"
        try {
            $cleaningGpo = New-GPO -Name $CleaningGPODisplayName -Domain $global:DomainName -Server $global:DomainControllerDNSName -Comment $global:CleaningGPODescription -ErrorAction Stop
        } catch [System.UnauthorizedAccessException] {
            Write-Error "[!] Could not create the GPO, please run this script under a domain account with permissions to create a GPO (and link it to the Domain Controllers OU)." -ErrorAction Stop
        }
    }

    $uninstallScriptPayload = @"

    function Uninstall-WMIConsumers {
        # .SYNOPSIS This function removes all WMI bindings and existing Powershell listener processes
        process {
            try {
                # Percent does not work as pattern for 2008R2
                `$NameFilterPattern = """AlsidForAD""" + [System.Text.Encoding]::UTF8.GetString([System.Convert]::FromBase64String("""JQ=="""))

                # Remove old WMI consumer
                `$FilterParams = @{
                    'Namespace' = 'root\subscription'
                    'Class' = '__EventFilter'
                    'Filter' = """Name LIKE '`$NameFilterPattern'"""
                }
                `$filter = Get-WmiObject @FilterParams -ErrorAction SilentlyContinue | Remove-WmiObject -ErrorAction SilentlyContinue
                Write-Host """[-] Existing WMI filter AlsidForAD-Launcher removed"""
                `$activeScriptConsumerParams = @{
                    'Namespace' = 'root\subscription'
                    'Class' = 'ActiveScriptEventConsumer'
                    'Filter' = """Name LIKE '`$NameFilterPattern'"""
                }
                `$activeScriptConsumer = Get-WmiObject @activeScriptConsumerParams -ErrorAction SilentlyContinue | Remove-WmiObject -ErrorAction SilentlyContinue
                `$logFileConsumerParams = @{
                    'Namespace' = 'root\subscription'
                    'Class' = 'LogFileEventConsumer'
                    'Filter' = """Name LIKE '`$NameFilterPattern'"""
                }
                `$logFileConsumer = Get-WmiObject @logFileConsumerParams -ErrorAction SilentlyContinue | Remove-WmiObject -ErrorAction SilentlyContinue
                Write-Host """[-] Existing WMI consumers AlsidForAD-Launcher removed"""
                Get-WmiObject -Class '__FilterToConsumerBinding' -Namespace 'root\subscription'| Where-Object { `$_.Filter -like '__EventFilter.Name="""AlsidForAD*'} | Remove-WmiObject -ErrorAction SilentlyContinue
                Write-Host """[-] Existing WMI binding AlsidForAD-Launcher removed"""

                # Kill running IOA engines
                # Delete Alsid and TenableADEventsListener processes too
                Get-WmiObject Win32_Process -Filter """name = 'Register-TenableADEventsListener.exe'""" | ForEach-Object { Stop-Process -Id `$_.ProcessId -Force }
                # Delete TenableWMIListener Powershell processes from the old script too
                Get-WmiObject Win32_Process -Filter """name = 'powershell.exe'""" | Where-Object { (`$_.CommandLine -match """alsid""" -Or `$_.CommandLine -match """Register-TenableWMIListener""" -Or `$_.CommandLine -match """Register-TenableADWMIListener""") -And `$_.ProcessId -ne `$pid } | ForEach-Object { Stop-Process -Id `$_.ProcessId -Force }
            }
            catch {
                Write-Error `$_.Exception
            }
        }
    }
    function Clean-OldTasks {
        # Delete Alsid for AD and Tenable for AD tasks too: to remove later when releasing 3.0
        `$command = 'Start-Sleep 10; try { `$tenableTasks = Get-ScheduledTask | Where-Object { `$_.TaskName.StartsWith("""Alsid""") -Or `$_.TaskName.StartsWith("""TenableTask""") -Or `$_.TaskName.StartsWith("""TenableCleaningTask""") -Or `$_.TaskName.StartsWith("""TenableADTask""") -Or `$_.TaskName.StartsWith("""TenableADCleaningTask""") } } catch { Write-Host """[-] Get-ScheduledTask cmdlet is missing from this system, cannot clean old task"""; return; }; foreach (`$task in `$tenableTasks) { `$taskName = `$task.TaskName; Unregister-ScheduledTask -TaskName `$taskName -Confirm:`$False }'
        `$bytes = [System.Text.Encoding]::Unicode.GetBytes(`$command)
        `$encodedCommand = [Convert]::ToBase64String(`$bytes)
        Start-Process powershell.exe -ArgumentList @("""-noprofile""", """-executionpolicy""", """bypass""", """-encodedCommand""", `$encodedCommand)
    }
    Uninstall-WMIConsumers
    Clean-OldTasks
"@
    try {

        # Ensure temporary folder is created
        Write-Information "[-] Checking custom temporary folder existence: $TemporaryFolderLocation"
        If (!(Test-Path -Path $TemporaryFolderLocation)) {
            Write-Information "[-] Creating custom temporary folder: $TemporaryFolderLocation"
            New-Item -ItemType Directory -Path $TemporaryFolderLocation -ErrorAction Stop | Out-Null
        }

        # Backup the GPO
        Write-Information "[-] Backing-up cleaning GPO: $CleaningGPODisplayName"
        $BackupCommand = (Backup-Gpo -Name $CleaningGPODisplayName -Domain $global:DomainName -Server $global:DomainControllerDNSName -Path $TemporaryFolderLocation -ErrorAction Stop)
        $BackupCommand | Out-Null
        $BackupId = $BackupCommand.Id
        $GpoId = $BackupCommand.GpoId
        $Newguid = [guid]::NewGuid()

        # Create scheduled task to execute event listener
        $TaskModifiedDate = (Get-Date).ToUniversalTime().ToString("yyyy-MM-dd HH:mm:ss")

        # Create the ScheduledTasks.xml
        $ImmediateTaskXml = '<ImmediateTaskV2 clsid="{9756B581-76EC-4169-9AFC-0CA8D43ADB5F}" name="TenableADCleaningTask___UID__" image="0" changed="__CHANGED__" uid="{__UID__}" userContext="0" removePolicy="0"><Properties action="C" name="TenableADCleaningTask___UID__" runAs="NT AUTHORITY\System" logonType="S4U"><Task version="1.3"><RegistrationInfo><Author>Tenable.ad</Author><Description>This scheduled task has been created as part of the deployment of Tenable.ad</Description></RegistrationInfo><Principals><Principal id="Author"><UserId>NT AUTHORITY\System</UserId><LogonType>S4U</LogonType><RunLevel>HighestAvailable</RunLevel></Principal></Principals><Settings><UseUnifiedSchedulingEngine>false</UseUnifiedSchedulingEngine><IdleSettings><Duration>PT1M</Duration><WaitTimeout>PT2H</WaitTimeout><StopOnIdleEnd>false</StopOnIdleEnd><RestartOnIdle>false</RestartOnIdle></IdleSettings><MultipleInstancesPolicy>IgnoreNew</MultipleInstancesPolicy><DisallowStartIfOnBatteries>false</DisallowStartIfOnBatteries><StopIfGoingOnBatteries>false</StopIfGoingOnBatteries><AllowHardTerminate>false</AllowHardTerminate><StartWhenAvailable>true</StartWhenAvailable><AllowStartOnDemand>false</AllowStartOnDemand><Enabled>true</Enabled><Hidden>false</Hidden><ExecutionTimeLimit>PT0S</ExecutionTimeLimit><Priority>7</Priority></Settings><Actions Context="Author"><Exec><Command>%SystemRoot%\system32\WindowsPowerShell\v1.0\powershell.exe</Command><Arguments>-NoProfile -NonInteractive -Command (Invoke-Command -ScriptBlock {__SCRIPT__})</Arguments></Exec></Actions><Triggers><RegistrationTrigger><Enabled>true</Enabled></RegistrationTrigger></Triggers></Task></Properties></ImmediateTaskV2>'
        $TaskXML = '<?xml version="1.0" encoding="utf-8"?><ScheduledTasks clsid="{CC63F200-7309-4ba0-B154-A71CD118DBCC}">' + $ImmediateTaskXml + '</ScheduledTasks>'

        $TaskXML = $TaskXML.replace("__CHANGED__", $TaskModifiedDate)
        $TaskXML = $TaskXML.replace("__UID__", $Newguid)
        $TaskXML = $TaskXML.replace("__SCRIPT__", $uninstallScriptPayload)

        Write-Information "[-] Creating immediate scheduled task to unregister event listener and WMI active script consumer, changed at: $TaskModifiedDate, with uid $Newguid"
        $TaskXMLParentPath = $TemporaryFolderLocation + '{' + $BackupId + '}\DomainSysvol\GPO\Machine\Preferences\ScheduledTasks'
        Write-Information "[-] Checking custom temporary scheduled tasks folder existence: $TaskXMLParentPath"
        If (!(Test-Path $TaskXMLParentPath)) {
            Write-Information "[-] Creating custom temporary scheduled tasks folder: $TaskXMLParentPath"
            $null = New-Item -Path $TaskXMLParentPath -ItemType Directory -ErrorAction Stop
        }

        $TaskXMLPath = $TaskXMLParentPath + '\ScheduledTasks.xml'

        Write-Information "[-] Creating immediate task xml file at: $TaskXMLPath"
        $UTF8Only = New-Object System.Text.UTF8Encoding($false)
        [System.IO.File]::WriteAllLines($TaskXMLPath, $TaskXML, $UTF8Only)

        $BackupXmlPath = $TemporaryFolderLocation + "{" + $BackupId + "}" + "\Backup.xml"
        $GpReportPath = $TemporaryFolderLocation + "{" + $BackupId + "}" + "\gpreport.xml"

        $BackupContent = @"
<?xml version="1.0" encoding="utf-8"?><!-- Copyright (c) Microsoft Corporation.  All rights reserved. --><GroupPolicyBackupScheme bkp:version="2.0" bkp:type="GroupPolicyBackupTemplate" xmlns:bkp="http://www.microsoft.com/GroupPolicy/GPOOperations" xmlns="http://www.microsoft.com/GroupPolicy/GPOOperations">
        <GroupPolicyObject><SecurityGroups/><FilePaths/><GroupPolicyCoreSettings><ID><![CDATA[{__GPOID__}]]></ID><Domain></Domain><SecurityDescriptor>01 00 04 9c 00 00 00 00 00 00 00 00 00 00 00 00 14 00 00 00 04 00 ec 00 08 00 00 00 05 02 28 00 00 01 00 00 01 00 00 00 8f fd ac ed b3 ff d1 11 b4 1d 00 a0 c9 68 f9 39 01 01 00 00 00 00 00 05 0b 00 00 00 00 00 24 00 ff 00 0f 00 01 05 00 00 00 00 00 05 15 00 00 00 a7 88 56 9c ab c3 34 78 fe ad f0 38 00 02 00 00 00 02 24 00 ff 00 0f 00 01 05 00 00 00 00 00 05 15 00 00 00 a7 88 56 9c ab c3 34 78 fe ad f0 38 00 02 00 00 00 02 24 00 ff 00 0f 00 01 05 00 00 00 00 00 05 15 00 00 00 a7 88 56 9c ab c3 34 78 fe ad f0 38 07 02 00 00 00 02 14 00 94 00 02 00 01 01 00 00 00 00 00 05 09 00 00 00 00 02 14 00 94 00 02 00 01 01 00 00 00 00 00 05 0b 00 00 00 00 02 14 00 ff 00 0f 00 01 01 00 00 00 00 00 05 12 00 00 00 00 0a 14 00 ff 00 0f 00 01 01 00 00 00 00 00 03 00 00 00 00</SecurityDescriptor><DisplayName/><Options><![CDATA[0]]></Options><UserVersionNumber><![CDATA[0]]></UserVersionNumber><MachineVersionNumber><![CDATA[131074]]></MachineVersionNumber><MachineExtensionGuids><![CDATA[[{00000000-0000-0000-0000-000000000000}{CAB54552-DEEA-4691-817E-ED4A4D1AFC72}][{AADCED64-746C-4633-A97C-D61349046527}{CAB54552-DEEA-4691-817E-ED4A4D1AFC72}]]]></MachineExtensionGuids><UserExtensionGuids/><WMIFilter/></GroupPolicyCoreSettings>
            <GroupPolicyExtension bkp:ID="{F15C46CD-82A0-4C2D-A210-5D0D3182A418}" bkp:DescName="Unknown Extension">
                <FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Preferences" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Preferences" bkp:Location="DomainSysvol\GPO\Machine\Preferences"/>
                <FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Preferences\ScheduledTasks" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Preferences\ScheduledTasks" bkp:Location="DomainSysvol\GPO\Machine\Preferences\ScheduledTasks"/>
                <FSObjectFile bkp:Path="%GPO_MACH_FSPATH%\Preferences\ScheduledTasks\ScheduledTasks.xml" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Preferences\ScheduledTasks\ScheduledTasks.xml" bkp:Location="DomainSysvol\GPO\Machine\Preferences\ScheduledTasks\ScheduledTasks.xml"/>
            </GroupPolicyExtension>
        </GroupPolicyObject>
    </GroupPolicyBackupScheme>
"@

        Write-Information "[-] Customizing GPO backup with scheduled task xml file"
        $BackupContent = $BackupContent.replace("__GPOID__", $GpoId)
        $BackupContent | Set-Content -Encoding ASCII -Path $BackupXmlPath -ErrorAction Stop
        Write-Information "[-] GPO custom backup set up"

        Write-Information "[-] Checking GPO report file existence: $GpReportPath"
        If (!(Test-Path $GpReportPath)) {
            Write-Information "[-] Getting GPO report file: $GpReportPath"
            Get-GPOReport -Name $CleaningGPODisplayName -Domain $global:DomainName -Server $global:DomainControllerIpAddress -ReportType XML -Path $GpReportPath -ErrorAction SilentlyContinue
        }

        # Manage case when DFSR replication interfere (https://docs.microsoft.com/en-us/troubleshoot/windows-server/group-policy/directory-is-not-empty)
        # Try to import 10 times
        For ($i = 1; $i -le 10; $i++) {

            If ($i -gt 1) {
                $retryDelay = $i * 2
                Write-Host "Importing GPO failed, try ($i/3) in $retryDelay seconds"
                Start-Sleep -Seconds $retryDelay
            }

            # Import back GPO
            try {
                Write-Information "[-] Importing GPO: $CleaningGPODisplayName"
                $ImportedGpo = Import-GPO -Domain $global:DomainName -Server $global:DomainControllerDNSName -BackupId $BackupId -TargetName $CleaningGPODisplayName -Path (Resolve-Path $TemporaryFolderLocation).Path -ErrorAction Stop

                If ($Null -ne $ImportedGpo) {
                    break
                }
            } catch {
                Write-Error $_.Exception
            }
        }

        If ($Null -eq $ImportedGpo) {
            throw "Importing GPO '$CleaningGPODisplayName' failed: replication process may be on progress, try again later"
        }

        # Link the cleaning GPO to the DC organizational unit
        Write-Information "[-] Linking GPO $CleaningGPODisplayName to $global:DomainControllerOU_DN in domain $global:DomainName on domain controller $global:DomainControllerDNSName"
        Remove-GPLink -Name $CleaningGPODisplayName -Target $global:DomainControllerOU_DN -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue | Out-Null
        try {
            New-GPLink -Name $CleaningGPODisplayName -Target $global:DomainControllerOU_DN -Domain $global:DomainName -Server $global:DomainControllerDNSName -Enforced Yes -ErrorAction Stop | Out-Null
        } catch [System.UnauthorizedAccessException] {
            Write-Error "[!] Could not link the GPO, please run this script under a domain account with permissions to (create a GPO and) link it to the Domain Controllers OU." -ErrorAction Stop
        }

        Write-Host "`n[+] All done."
        Write-Host "[+] Cleaning GPO $GpoId successfully linked to $global:DomainName"
        Write-Host "[+] Tenable.ad Attack Detection Module successfully removed.`n"
    } catch {
        Write-Error $_.Exception
    } finally {
        # Cleaning
        Remove-Item -Recurse -Force $TemporaryFolderLocation -ErrorAction SilentlyContinue | Out-Null
        Write-Information "[-] Removing temporary folder: $TemporaryFolderLocation`n"
    }
}

function Delete-GPO {
    param(
        [Parameter(Mandatory = $true)]
        [String]
        $GpoName,
        [Parameter(Mandatory = $true)]
        [String]
        $GpoDescription
    )

    process {
        $deletedGpoId = $Null
        try {
            $createdGpo = Get-GPO -Name $GpoName -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue
            Write-Information "[-] Trying to get existing GPO: $GpoName"
            If ($Null -eq $createdGpo) {
                # If GPO name was customized at install but wasn't given as parameter for uninstall
                # Try finding it by description instead
                $createdGpo = Get-GPO -All -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue | Where-Object { $_.Description -eq $GpoDescription } | Select-Object -First 1
            }

            $deletedGpoId = $createdGpo.Id

            If ($Null -ne $createdGpo) {
                Write-Information "[-] Removing GPO: $($createdGpo.DisplayName)"
                # Remove previously created GPO (will be replicated)
                $createdGpo | Remove-GPO -Domain $global:DomainName
            }
        } catch {
            Write-Error $_.Exception
        }

        return $deletedGpoId
    }
}

function New-GPOScheduledTask {
    param(
        [Parameter(Mandatory = $false)]
        [String]
        $OldGpoId
    )

    Write-Host "[-] GPO name to be deployed: $GPODisplayName"

    # Create an empty GPO to get its GUID
    Write-Information "[-] Trying to get existing GPO: $GPODisplayName"
    $gpoNew = Get-GPO -Name $GPODisplayName -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue
    If (-Not $gpoNew) {
        Write-Information "[-] GPO does not exist, creating new one: $GPODisplayName"
        try {
            $gpoNew = New-GPO -Name $GPODisplayName -Domain $global:DomainName -Server $global:DomainControllerDNSName -Comment $global:GPODescription
        } catch [System.UnauthorizedAccessException] {
            Write-Error "[!] Could not create the GPO, please run this script under a domain account with permissions to create a GPO (and link it to the Domain Controllers OU)." -ErrorAction Stop
        }
    }

    # Create the persistent event listener log forwarder payload`
    Write-Host "[-] Building immediate task body"
    $installScriptPayload = @"
    Import-Module ActiveDirectory

    `$localDomainController = Get-ADDomainController 127.0.0.1
    `$currentDomain = Get-ADDomain
    `$currentDomainDn = `$currentDomain.DistinguishedName
    `$global:EnvMachineName = `$env:computername
    `$global:OsVersion = [System.Environment]::OSVersion.Version
    `$global:OsVersion = [System.String]::Concat(`$global:OsVersion.Major, """.""", `$global:OsVersion.Minor, """.""", `$global:OsVersion.Build)
    `$global:LocalDomainControllerDNSName = `$localDomainController.HostName
    `$global:LocalDomainControllerSite = `$localDomainController.Site
    `$global:PrimaryDomainControllerFilter = `$Null
    If (`$Null -ne `$currentDomain.PDCEmulator) {
        `$global:PrimaryDomainControllerFilter = `$currentDomain.PDCEmulator
    } Else {
        `$global:PrimaryDomainControllerFilter = '__PDCIPADDRESS__'
    }
    `$global:PrimaryDomainControllerSite = (Get-ADDomainController `$global:PrimaryDomainControllerFilter).Site
    `$global:AuditPath = '__AUDITFOLDER__'
    `$global:AuditPath = `$global:AuditPath.replace("""__DNSNAME__""", `$global:LocalDomainControllerDNSName)
    `$global:AuditCSVPath = `$global:AuditPath + 'audit.csv'
    `$envTemp = (Get-Item `$env:TEMP).Fullname
    `$global:TemporaryTaskFolderLocation = `$envTemp + '\TenableADTask_' +  [guid]::NewGuid() + '\'
    `$global:TempAuditCsvFileLocation = `$global:TemporaryTaskFolderLocation + 'audit.csv'
    `$sysvolLocationRegKey = Get-Item -LiteralPath 'HKLM:\SYSTEM\CurrentControlSet\Services\Netlogon\Parameters' -ErrorAction Stop
    `$defaultSysvolPath = `$sysvolLocationRegKey.GetValue('Sysvol', `$Null)
    `$global:IoaFolderLocation = `$defaultSysvolPath + """\\""" + `$currentDomain.DnsRoot + """\Policies\{__GPOID__}\Machine\IOA"""
    `$global:GptIniLocation = `$defaultSysvolPath + """\\""" + `$currentDomain.DnsRoot + """\Policies\{__GPOID__}\gpt.ini"""
    `$global:DeleteOldGpo = `$__CLEANOLDGPO__
    `$global:OldGpoFolder = `$defaultSysvolPath + """\\""" + `$currentDomain.DnsRoot + """\Policies\{__OLDGPOID__}"""
    `$global:Channels = @(__CHANNELS__)

    function Register-Channels {
        # .SYNOPSIS This function enables the channels required for listening events
        try {
            Write-Host """[-] Registering channels..."""
            foreach (`$channel in `$global:Channels) {
                Write-Host """[-] Registering: """ `$channel
                (Get-Item HKLM:\).OpenSubKey("""SYSTEM""", `$True).CreateSubKey("""CurrentControlSet\Services\EventLog\\""" + `$channel)
            }
        } catch {
            Write-Error `$_.Exception
        }
    }

    function Register-EventListener {
        # .SYNOPSIS This function creates the event listener

        process {
            try {
                Write-Host """[-] Running executable Register-TenableADEventsListener.exe"""
                `$executableLocation = `$global:IoaFolderLocation + '\Register-TenableADEventsListener.exe'

                `$domainControllerEventLogFileLocation = `$global:IoaFolderLocation + '\' + `$global:EnvMachineName + '-' + `$global:OsVersion + '-1_' + '.gz'
                Write-Host """[-] Events will be written to path: `$domainControllerEventLogFileLocation"""

                # Events file write frequency depends upon the fact current DC is in PDC site and FRS is still in use
                `$ioaFileWriteFrequencyInSeconds = 15
                try {
                    `$dfsrFilter = 'DistinguishedName -eq """CN=DFSR-GlobalSettings,' + `$((Get-ADDomain).SystemsContainer) + '"""'
                    `$dfsrObject = Get-ADObject -Filter `$dfsrFilter -Properties msDFSR-Flags
                    If(`$Null -ne `$dfsrObject -And `$dfsrObject.'msDFSR-Flags' -eq 48) {
                        # 48 means DFSR is active
                        Write-Host """[-] Current domain controller replication process is handled by DFSR"""
                    } Else {
                        Write-Host """[-] Current domain controller replication is (still) handled by FRS instead of DFSR"""
                        If(`$global:LocalDomainControllerSite -eq `$global:PrimaryDomainControllerSite) {
                            Write-Host """[-] Current domain controller is in primary domain controller site (`$global:PrimaryDomainControllerSite): intra-site replication applies"""
                        } Else {
                            Write-Host """[-] Current domain controller site (`$global:LocalDomainControllerSite) is in a site different from primary domain controller site (`$global:PrimaryDomainControllerSite): inter-site replication applies"""
                            `$interSitesIpDn = """CN=IP,CN=Inter-Site Transports,CN=Sites,CN=Configuration,""" + `$currentDomainDn
                            `$repAdminOutput = repadmin /showism `$interSitesIpDn /verbose
                            `$repInterval = Get-InterSitesReplicationIntervalMinutes -Output `$repAdminOutput -SourceSiteDn `$global:LocalDomainControllerSite -DestinationSiteDn `$global:PrimaryDomainControllerSite
                            `$fileWriteFrequencyInMinutes = [int]`$repInterval + 5
                            `$ioaFileWriteFrequencyInSeconds = `$fileWriteFrequencyInMinutes * 60
                            Write-Host """[-] Shortest path found between sites `$global:LocalDomainControllerSite and `$global:PrimaryDomainControllerSite : events file will be written every `$fileWriteFrequencyInMinutes minutes"""
                        }
                    }
                } catch {
                    Write-Error `$_.Exception
                }

                # Start events listening
                `$domainControllerEventLogFileLocationString = '"""' + `$domainControllerEventLogFileLocation + '"""'
                `$executableArguments = @('-t',`$ioaFileWriteFrequencyInSeconds,'-p',`$domainControllerEventLogFileLocationString,'-g','-w')
                `$startedProcessPid = (Start-Process -PassThru -WorkingDirectory `$global:IoaFolderLocation -WindowStyle Hidden -FilePath `$executableLocation -ArgumentList `$executableArguments).Id
                Register-RestartListener -IoaExeEngineName `$executableLocation -IoaFolderPath `$global:IoaFolderLocation -EventsFilePath `$domainControllerEventLogFileLocation -FileWriteIntervalInSeconds `$ioaFileWriteFrequencyInSeconds -StartedProcessId `$startedProcessPid
            } catch {
                Write-Error `$_.Exception
            }
        }
    }

    function Get-InterSitesReplicationIntervalMinutes {
        # .SYNOPSIS Parses and extracts replication interval from repadmin showism

        param(
        [Parameter(Mandatory = `$true)]
        [Object[]]
        `$Output,
        [Parameter(Mandatory = `$true)]
        [String]
        `$SourceSiteDn,
        [Parameter(Mandatory = `$true)]
        [String]
        `$DestinationSiteDn
        )

        `$lines = (`$Output | Select-String -Pattern """`$SourceSiteDn""" | Select-String -Pattern """`$DestinationSiteDn""")
        If (`$lines.Length -le 0 -Or -Not(`$lines[0].Line.EndsWith("""):"""))) {
            return 15
        }

        Write-Host """[-] Connection found in showism output:"""
        Write-Host `$lines[0]

        return (`$lines[0].Line.Split(' '))[-1].Split(')')[0]
    }

    function Register-RestartListener {
        # .SYNOPSIS This function recreates event listener at startup

        param(
        [Parameter(Mandatory = `$true)]
        [String]
        `$IoaExeEngineName,
        [Parameter(Mandatory = `$true)]
        [String]
        `$IoaFolderPath,
        [Parameter(Mandatory = `$true)]
        [String]
        `$EventsFilePath,
        [Parameter(Mandatory = `$true)]
        [Int]
        `$FileWriteIntervalInSeconds,
        [Parameter(Mandatory = `$true)]
        [Int]
        `$StartedProcessId,
        [Parameter(Mandatory = `$false)]
        [Int]
        `$WmiTriggerPeriodInSec = 600
        )

        # Remove old WMI consumer
        `$FilterParams = @{
            'Namespace' = 'root\subscription'
            'Class' = '__EventFilter'
            'Filter' = """Name = 'AlsidForAD-Launcher'"""
        }
        `$filter = Get-WmiObject @FilterParams -ErrorAction SilentlyContinue | Remove-WmiObject -ErrorAction SilentlyContinue
        Write-Host """[-] Existing WMI filter AlsidForAD-Launcher removed"""
        `$ConsumerParams = @{
            'Namespace' = 'root\subscription'
            'Class' = 'ActiveScriptEventConsumer'
            'Filter' = """Name = 'AlsidForAD-Launcher'"""
        }
        `$consumer = Get-WmiObject @ConsumerParams -ErrorAction SilentlyContinue | Remove-WmiObject -ErrorAction SilentlyContinue
        Write-Host """[-] Existing WMI consumer AlsidForAD-Launcher removed"""
        Get-WmiObject -Class '__FilterToConsumerBinding' -Namespace 'root\subscription' -Filter """Filter = """"""__EventFilter.name='AlsidForAD-Launcher'""""""""" | Remove-WmiObject -ErrorAction SilentlyContinue
        Write-Host """[-] Existing WMI binding AlsidForAD-Launcher removed"""

        # Kill running IOA engines
        Get-WmiObject Win32_Process -Filter """name = 'powershell.exe'""" | Where-Object { (`$_.CommandLine -match """alsid""" -Or `$_.CommandLine -match """Register-TenableADWMIListener""") -And `$_.ProcessId -ne `$pid -And `$_.ProcessId -ne `$StartedProcessId } | ForEach-Object { Stop-Process -Id `$_.ProcessId -Force }
        Get-WmiObject Win32_Process -Filter """name = 'Register-TenableADEventsListener.exe'""" | Where-Object { `$_.ProcessId -ne `$pid -And `$_.ProcessId -ne `$StartedProcessId } | ForEach-Object { Stop-Process -Id `$_.ProcessId -Force }

        # Register new WMI consumer
        `$LauncherFilterQuery = """Select * From __InstanceModificationEvent Within `$WmiTriggerPeriodInSec Where Targetinstance ISA 'Win32_PerfFormattedData_PerfOS_System' AND TargetInstance.SystemUpTime &gt;= 300 AND TargetInstance.SystemUpTime &lt; 37800"""

        `$WmiLauncherFilterParams = @{
            'Class'     = '__EventFilter'
            'Namespace' = 'root\subscription'
            'Arguments' = @{ Name = 'AlsidForAD-Launcher'; EventNameSpace = 'root\cimv2'; QueryLanguage = 'WQL'; Query = `$LauncherFilterQuery }
        }
        `$WmiLauncherEventFilterPath = Set-WmiInstance @WmiLauncherFilterParams -ErrorAction Stop
        Write-Host """[-] WMI filter AlsidforAD-Launcher registered"""

        `$command = """Start-Process -WorkingDirectory '`$IoaFolderPath' -WindowStyle Hidden -FilePath '`$IoaExeEngineName' -ArgumentList @('-t','`$FileWriteIntervalInSeconds','-p','`$EventsFilePath','-g','-w')"""
        `$bytes = [System.Text.Encoding]::Unicode.GetBytes(`$command)
        `$encodedCommand = [Convert]::ToBase64String(`$bytes)

        `$LauncherEventConsumerArgs = @{
            Name = 'AlsidForAD-Launcher'
            ScriptingEngine = 'VBScript'
            ScriptText = '
            Dim fso, objShell, psCmdLine, encodedPwCommand
            Set fso = CreateObject("""Scripting.FileSystemObject""")
            Set objShell = CreateObject("""Wscript.shell""")
            ioaEnginePath = """' + `$IoaExeEngineName + '"""
            encodedPwCommand = """' + `$encodedCommand + '"""
            psCmdLine = """powershell.exe -encodedCommand """ + encodedPwCommand

            Function IsAlsidIoaRunning
                Set objWMIService = GetObject("""winmgmts:\\.\root\cimv2""")
                Set colItems = objWMIService.ExecQuery ("""Select * from Win32_Process Where Name = """ &amp; Chr(39) &amp; """Register-TenableADEventsListener.exe""" &amp; Chr(39))
                For Each objItem in colItems
                    IsAlsidIoaRunning = true
                    Exit Function
                Next
                IsAlsidIoaRunning = false
            End Function

            If fso.FileExists(ioaEnginePath) Then
                If (IsAlsidIoaRunning() = false) Then
                    objShell.run psCmdLine, 0
                End If
            End If
            '
        }
        `$WmiLauncherConsumerParams = @{
          Namespace = 'root/subscription'
          Class = 'ActiveScriptEventConsumer'
          Arguments = `$LauncherEventConsumerArgs
        }
        `$WmiLauncherConsumer = Set-WmiInstance @WmiLauncherConsumerParams -ErrorAction Stop
        Write-Host """[-] WMI consumer AlsidforAD-Launcher registered"""

        `$WmiLauncherFilterConsumerParams = @{
          'Class'     = '__FilterToConsumerBinding'
          'Namespace' = 'root\subscription'
          'Arguments' = @{ Filter = `$WmiLauncherEventFilterPath; Consumer = `$WmiLauncherConsumer }
        }
        Set-WmiInstance @WmiLauncherFilterConsumerParams -ErrorAction Stop | Out-Null
        Write-Host """[-] WMI binding AlsidforAD-Launcher registered"""
    }

    function Generate-AuditCsv {
        # .SYNOPSIS This function generates an audit.csv file to backport custon audit policies (both already existing and ours)

        # Basic vs Advanced
        # audit.csv is stored in the GPO SYSVOL folder and is read by the "audit policy configuration" CSE, it's the native format generated when editing **advanced** audit policy in the GPO editor
        # in Windows there are two sets of audit policy settings, basic (9 top-level categories in "audit policy") and **advanced** (53 sub-level categories in 10 categories)
        # we want to use **advanced** through audit.csv added to our GPO, because it allows a more granular configuration
        # the CSE properly handles when several GPOs define **advanced** audit policies through precedence and merging
        # Warning: GPO priority matters in merging. For example, if a first GPO, with a higher priority, enables "Success" logging, and a second GPO, with a lower priority, enables "Success and Failure" logging, then only "Success" will be logged!
        # Given that the Tenable.ad GPO will have an higher priority ("enforced" is checked), we ensure that we do not mask a setting required by a lower priority GPO, see in code below

        # RsOP output generation as SYSTEM user
        # this immediate task script runs as SYSTEM, and in some cases, gpresult fails if we don't specify a user (even though we only request RSOP for the computer scope...)
        # so we retry while giving to gpresult a user that can authenticate locally on a domain controller to simulate the RSOP. The builtin RID 500 admin is used

        # audit.csv single generation
        # The first domain controller in the domain which will execute this immediate task (most likely the one targeted by the install script, or where it is launched) will generate the audit policy and thus the audit.csv file
        # then it will be replicated to other domain controllers, so we only generate audit.csv if it does not already exist

        process {
            try {
                # Create the audit.csv with Tenable.ad required logging settings

                `$AuditCSV = `@'
Machine Name,Policy Target,Subcategory,Subcategory GUID,Inclusion Setting,Exclusion Setting,Setting Value
__ROOTAUDITCSV__
'`@

                If (!(Test-Path -Path `$global:TemporaryTaskFolderLocation)) {
                    New-Item -ItemType Directory -Path `$global:TemporaryTaskFolderLocation -ErrorAction Stop | Out-Null
                    Write-Host """[-] Temporary folder `$global:TemporaryTaskFolderLocation created"""
                }
                `$RsopFilePath = `$global:TemporaryTaskFolderLocation + 'rsop.xml'

                Write-Host """[-] Generating RsOP file at `$RsopFilePath"""
                gpresult.exe /SCOPE COMPUTER /X `$RsopFilePath
                Write-Host """[-] No error occurred while generating RsOP file at `$RsopFilePath"""
                If (!(Test-Path `$RsopFilePath)) {
                    Write-Host """[-] Generating RsOP file at `$RsopFilePath failed"""
                    `$administratorSid = (Get-ADDomain).DomainSID.Value + "-500"
                    `$administrator = Get-ADUser -Identity `$administratorSid
                    `$administratorName = `$administrator.SamAccountName
                    Write-Host """[-] Generating RsOP file at `$RsopFilePath for `$administratorName"""
                    gpresult.exe /SCOPE COMPUTER /X `$RsopFilePath /USER `$administratorName
                    Write-Host """[-] No error occurred while generating RsOP file at `$RsopFilePath for `$administratorName"""
                    If (!(Test-Path `$RsopFilePath)) {
                        Write-Host """[-] RSOP file was not generated"""
                        throw """RSOP file generation failed"""
                    }
                }
                Write-Host """[-] RSOP file generated"""

                `$Audit = `$AuditCSV | ConvertFrom-Csv
                `$AuditC = @()
                `$AuditC += `$Audit
                Write-Host """[-] Needed audit policies converted from csv format"""

                [xml]`$Xml = Get-Content -Path `$RsopFilePath
                Write-Host """[-] Generated RsOP output:"""
                Write-Host `$Xml.OuterXml
                `$AdvAuditPolicies = `$Xml.Rsop.ComputerResults.ExtensionData | where-object { `$_.Name.'#text' -Match """Advanced Audit Configuration""" }
                `$Rsop = `$AdvAuditPolicies | Select-Object -ExpandProperty Extension | Select-Object -ErrorAction SilentlyContinue -ExpandProperty AuditSetting | Select-Object -Property SubcategoryGuid, SettingValue, SubcategoryName
                If (`$Null -eq `$Rsop) {
                    `$Rsop = @()
                }
                Write-Host """[-] Advanced audit policies extracted from generated file:"""
                Write-Host `$AdvAuditPolicies.OuterXml
                Write-Host """[-] RsOP extracted from generated file:"""
                `$joinedRsop = `$Rsop | Foreach {`$_.SubcategoryGuid + ' (' + `$_.SubcategoryName + '): ' + `$_.SettingValue}
                Write-Host (`$joinedRsop -join ',')

                # Getting effective audit policy settings currently in use
                auditpol.exe /backup /file:"""`$(`$global:TempAuditCsvFileLocation)"""
                Write-Host """[-] Auditpol output generated at `$global:TempAuditCsvFileLocation"""
                `$auditBackupContent = Get-Content -Path `$global:TempAuditCsvFileLocation | Where-Object { `$_.trim() -ne """""" }
                `$Header = 'Machine Name', 'Policy Target', 'Subcategory', 'Subcategory GUID', 'Inclusion Setting', 'Exclusion Setting', 'Setting Value'
                `$auditBackupContent = `$auditBackupContent[1..(`$auditBackupContent.count - 1)]
                `$SubCat = `$auditBackupContent | ConvertFrom-Csv -Header `$Header
                `$SubCatC  = @()
                `$SubCatC  += `$SubCat
                Write-Host """[-] Auditpol output extracted and converted"""

                # Merging our **advanced** settings (`$AuditC) with potential already existing (`$Rsop) if ours risk masking them
                foreach (`$v in `$AuditC) {
                    `$subGuid = `$v.'Subcategory GUID'
                    `$subName = `$v.'Subcategory'

                    `$existingValue = `$SubCatC  | where-object { `$_.'Subcategory GUID' -match `$subGuid } | Select-Object -First 1

                    If (`$Null -eq `$existingValue) {
                        Write-Host """[-] No value found in auditpol output for `$subName (`$subGuid)"""
                        continue
                    }

                    # Checking if there is currently a setting that blocks something we need
                    If (`$existingValue.'Setting Value' -eq 0 -or `$existingValue.'Setting Value' -eq 4) {
                        `$RsopValue = `$Rsop | where-object { `$_.SubcategoryGuid -match `$subGuid } | Select-Object -First 1
                        If (`$Null -eq `$RsopValue) {
                            Write-Host """[-] No value found in RsOP output for `$subName (`$subGuid)"""
                            continue
                        }
                        If (`$RsopValue.SettingValue -eq 0 -or `$RsopValue.SettingValue -eq 4) {
                            `$SubcategoryError = 'Tenable.ad requires the audit policy ' + `$subName + ' but the current AD configuration prevents its usage'
                            throw `$SubcategoryError
                        }
                    }

                    If (`$existingValue.'Setting Value' -eq `$v.'Setting Value') {
                        Write-Host """[-] Value found in auditpol output is the one needed for `$subName (`$subGuid)"""
                        continue
                    }

                    Write-Host """[-] Setting value found in auditpol output to Success and Failure for `$subName (`$subGuid)"""
                    `$v.'Setting Value' = 3
                }

                # Converting existing basic configuration (not needed) to advanced one
                If ((`$Null -eq `$AdvAuditPolicies) -Or (`$AdvAuditPolicies.Extension.ChildNodes.Count -eq 0)) {
                    Write-Host """[-] Trying to convert existing basic audit policies to advanced ones"""
                    `$basicAuditPoliciesToMigrate = """Machine Name,Policy Target,Subcategory,Subcategory GUID,Inclusion Setting,Exclusion Setting,Setting Value""" + """`n"""
                    foreach (`$auditPoliciesSubCategory in `$SubCatC ) {
                        If (`$auditPoliciesSubCategory.'Subcategory GUID' -ne '' -And (-Not ((`$auditPoliciesSubCategory.'Setting Value' -eq 0) -Or (`$auditPoliciesSubCategory.'Setting Value' -eq 4)))) {
                            `$notNeededRsopValue = `$AuditC | where-object { `$_.'Subcategory GUID' -match `$auditPoliciesSubCategory.'Subcategory GUID' } | Select-Object -First 1
                            If (`$Null -eq `$notNeededRsopValue) {
                                `$auditPoliciesSubCategoryGuid = `$auditPoliciesSubCategory.'Subcategory GUID'
                                `$auditPoliciesSubCategoryName = `$auditPoliciesSubCategory.'Subcategory'
                                `$auditPoliciesSubCategoryValue = `$auditPoliciesSubCategory.'Setting Value'
                                Write-Host """[-] Existing audit policy `$auditPoliciesSubCategoryName (`$auditPoliciesSubCategoryGuid) value will be set to `$auditPoliciesSubCategoryValue like previously"""
                                `$newBasicSetting = `$auditPoliciesSubCategory.'Machine Name' + """,""" + `$auditPoliciesSubCategory.'Policy Target' + """,Audit """ + `$auditPoliciesSubCategory.Subcategory + """,""" + `$auditPoliciesSubCategory.'Subcategory GUID' + """,""" + `$auditPoliciesSubCategory.'Inclusion Setting' + """,""" + `$auditPoliciesSubCategory.'Exclusion Setting' + """,""" + `$auditPoliciesSubCategory.'Setting Value'
                                `$basicAuditPoliciesToMigrate = `$basicAuditPoliciesToMigrate + `$newBasicSetting + """`n"""
                            }
                        }
                    }
                    `$customCsv = `$basicAuditPoliciesToMigrate | ConvertFrom-Csv
                    `$CsvC = @()
                    `$CsvC += `$customCsv
                    `$AuditC += `$CsvC
                }

                `$AuditCSV = `$AuditC | ConvertTo-Csv -NoTypeInformation | ForEach-Object { `$_.replace('"""', '') }
                `$AuditCSV | Set-Content -Encoding UTF8 -Path `$global:AuditCSVPath -ErrorAction Stop
                Write-Host """[-] Generated audit policies to be deployed: `$AuditCSV"""

                # Clean task temporary folder
                Remove-Item -Recurse -Force `$global:TemporaryTaskFolderLocation -ErrorAction SilentlyContinue | Out-Null
                Write-Host """[-] Temporary folder `$global:TemporaryTaskFolderLocation cleaned"""
            }
            catch {
                Write-Error `$_.Exception
            }
        }
    }

    function Protect-IoaFolder {
        try {
            `$ioaFolderAcl = Get-Acl -Path `$global:IoaFolderLocation
            `$ioaFolderAcl.SetAccessRuleProtection(`$True, `$True)
            Set-Acl -Path `$global:IoaFolderLocation -AclObject `$ioaFolderAcl
            Write-Host """[-] Inheritance removed for directory `$global:IoaFolderLocation"""
            `$ioaFolderAcl = Get-Acl -Path `$global:IoaFolderLocation
            `$ioaFolderAclAccessRules = `$ioaFolderAcl.GetAccessRules(`$True, `$True, [System.Security.Principal.SecurityIdentifier])
            ForEach (`$acl in `$ioaFolderAclAccessRules) {
                `$aclIdentitySid = `$acl.IdentityReference.Value
                If (`$aclIdentitySid -eq 'S-1-5-11') {
                    `$Null = `$ioaFolderAcl.RemoveAccessRule(`$acl)
                    Write-Host '[-] Authenticated users group removed from IOA folder ACLs'
                }
            }
            `$tenableAccount = New-Object System.Security.Principal.NTAccount('__TENABLESERVICEACCOUNT__')
            `$tenableAccountSid = `$tenableAccount.Translate([System.Security.Principal.SecurityIdentifier])
            `$tenableAccountSidValue = `$tenableAccountSid.Value
            `$tenableAccountValue = `$tenableAccount.Value
            `$ruleReadOnly = New-Object System.Security.AccessControl.FileSystemAccessRule(`$tenableAccountSid, 'ReadAndExecute, Synchronize', 'ContainerInherit, ObjectInherit', 'None', 'Allow')
            `$ioaFolderAcl.AddAccessRule(`$ruleReadOnly)
            Write-Host """[-] Tenable.ad service account (`$tenableAccountSidValue : `$tenableAccountValue) ACL set for IOA folder"""
            Set-Acl -Path `$global:IoaFolderLocation -AclObject `$ioaFolderAcl
            Write-Host """[-] Right permissions set to IOA folder"""
        } catch {
            Write-Error `$_.Exception
        }
    }

    function Clean-OldTasks {
        try {
            `$tenableTasks = Get-ScheduledTask | Where-Object { `$_.TaskName.StartsWith("""TenableADTask""") -Or `$_.TaskName.StartsWith("""TenableADCleaningTask""") -Or `$_.TaskName.StartsWith("""AlsidTask""") -Or `$_.TaskName.StartsWith("""AlsidCleaningTask""") }
        } catch {
            Write-Host """[-] Get-ScheduledTask cmdlet is missing from this system, cannot clean old task"""
            return
        }

        If(`$tenableTasks.Count -gt 1){
            `$oldtenableTasks = `$tenableTasks | Get-ScheduledTaskInfo | Sort-Object LastRunTime -Descending | Select-Object -Skip 1
            foreach (`$task in `$oldtenableTasks) {
                `$taskName = `$task.TaskName
                Unregister-ScheduledTask -TaskName `$taskName -Confirm:`$False
                Write-Host """[-] Old task `$taskName cleaned"""
            }
        }
    }

    function Clean-OldGpo {
        Write-Host """[-] Old GPO folder `$global:OldGpoFolder will be cleaned"""
        `$cleanCommand = """Start-Sleep 10; If(Test-Path '`$global:OldGpoFolder') { Remove-Item '`$global:OldGpoFolder' -Recurse -Force }"""
        `$bytes = [System.Text.Encoding]::Unicode.GetBytes(`$cleanCommand)
        `$cleanEncodedCommand = [Convert]::ToBase64String(`$bytes)
        Start-Process powershell.exe -ArgumentList @("""-noprofile""", """-executionpolicy""", """bypass""", """-encodedCommand""", `$cleanEncodedCommand)
    }

    try {

        # Replication may occur after current immediate task is performed
        # Because immediate task may be pulled directly from another domain controller when a gpupdate happens
        # As we need the SYSVOL folders associated to our GPO replicated to the local domain controller before starting our process
        # We must wait for GPO to be replicated before performing this immediated task (24 hours maximum)
        For (`$i = 1; `$i -le 288; `$i++) {

            If (`$i -gt 1) {
                Start-Sleep 300
            }

            If(Test-Path `$global:GptIniLocation) {
                break
            }

            If (`$i -eq 288) {
                Exit
            }
        }

        `$LogfilePrefix = """TenableTranscript_"""
        Remove-Item `$(`$envTemp + '\' + `$LogfilePrefix + '*') -ErrorAction SilentlyContinue

        `$Logfile = `$LogfilePrefix + `$global:EnvMachineName + '_' + [guid]::NewGuid() + '.log'
        `$TranscriptsFolder = `$global:IoaFolderLocation + '\transcripts'
        If(`$PSVersionTable.PSVersion.Major -ge 5)
        {
            Start-Transcript -Path `$(`$TranscriptsFolder + '\' + `$Logfile) -IncludeInvocationHeader
            Start-Transcript -Path `$(`$envTemp + '\' + `$Logfile) -IncludeInvocationHeader
        }
        Else
        {
            # cannot Start-Transcript twice on older versions
            Start-Transcript -Path `$(`$TranscriptsFolder + '\' + `$Logfile)
        }

        Write-Host """[-] Starting script version v3.29.3, occurrence 1"""

        Write-Host """[-] Starting immediate task on DC `$global:EnvMachineName"""
        Write-Host """[-] Domain controller DNS name: `$global:LocalDomainControllerDNSName"""
        Write-Host """[-] Primary domain controller: `$global:PrimaryDomainControllerFilter"""
        Write-Host """[-] Primary domain controller site: `$global:PrimaryDomainControllerSite"""
        Write-Host """[-] Current domain controller site: `$global:LocalDomainControllerSite"""
        Write-Host """[-] Audit policies folder: `$global:AuditPath"""
        Write-Host """[-] Temporary folder: `$global:TemporaryTaskFolderLocation"""
        Write-Host """[-] IOA folder location: `$global:IoaFolderLocation"""

        # Cast to string for 2008R2
        If (!(Test-Path `$global:AuditCSVPath) -Or ((Get-Content `$global:AuditCSVPath) -eq `$NULL)) {
            Write-Host """[-] Generating audit.csv on first domain controller `$global:EnvMachineName"""
            Generate-AuditCsv
            Write-Host """[-] Running gpupdate /force"""
            Invoke-Command -ScriptBlock { gpupdate /force }
        } Else {
            Write-Host """[-] File audit.csv already exists"""
        }
        Protect-IoaFolder
        Register-Channels
        Register-EventListener
        Clean-OldTasks
        If(`$global:DeleteOldGpo) {
            Clean-OldGpo
        }
    }
    catch {
        Write-Error `$_.Exception
    }
    finally {
        Write-Host """[+] All done!`n"""
        Stop-Transcript
        If(`$PSVersionTable.PSVersion.Major -ge 5)
        {
            # we started two transcripts, so we stop twice
            Stop-Transcript
        }
    }
"@

    try {
        
        # Create POL file before GPO import
        foreach ($polRegValue in $global:PolRegistryValuesToSet) {
            $keyValue = $polRegValue -split  "="
            If ($keyValue.Length -lt 2) {
                continue
            }

            $regTypeValue = $keyValue[1] -split ","
            If ($regTypeValue.Length -lt 2) {
                continue
            }

            $regType = $regTypeValue[0]
            $finalRegValue = $regTypeValue[1]
            If ($regType -eq 4) {
                $finalRegValue = [int]$finalRegValue
            }

            $keyValuePathName = $keyValue[0] -split "\\"
            $regValueNameIndex = $keyValuePathName.Length - 1
            $lastregValuePathIndex = $keyValuePathName.Length - 2
            $regValueName = $keyValuePathName[$regValueNameIndex]
            $regPath = $keyValuePathName[0..$lastregValuePathIndex] -join "\"

            Write-Information "[-] Setting POL registry key $regPath, value $regValueName, type $regType to $finalRegValue"
            $Null = Set-GPRegistryValue -Name $GPODisplayName -Key $regPath -ValueName $regValueName -Type $regType -Value $finalRegValue -Domain $global:DomainName -Server $global:DomainControllerDNSName
        }

        # Ensure temporary folder is created
        Write-Information "[-] Checking custom temporary folder existence: $TemporaryFolderLocation"
        If (!(Test-Path -Path $TemporaryFolderLocation)) {
            Write-Information "[-] Creating custom temporary folder: $TemporaryFolderLocation"
            New-Item -ItemType Directory -Path $TemporaryFolderLocation -ErrorAction Stop | Out-Null
        }

        # Backup the GPO
        Write-Information "[-] Backing-up GPO: $GPODisplayName"
        $BackupCommand = (Backup-Gpo -Name $GPODisplayName -Domain $global:DomainName -Server $global:DomainControllerDNSName -Path $TemporaryFolderLocation -ErrorAction Stop)
        $BackupCommand | Out-Null
        $BackupId = $BackupCommand.Id
        $GpoId = $BackupCommand.GpoId
        $Newguid = [guid]::NewGuid()

        # Create event listener script content
        Write-Information "[-] Replacing tokens in immediate task embedded script"
        $installScriptPayload = $installScriptPayload.replace("__GPOID__", $GpoId)
        $installScriptPayload = $installScriptPayload.replace("__AUDITFOLDER__", "\\__DNSNAME__\sysvol\" + $global:DomainName + "\Policies\" + "{" + $GpoId + "}" + "\Machine\Microsoft\Windows NT\Audit\")
        $installScriptPayload = $installScriptPayload.replace("__TENABLESERVICEACCOUNT__", $TenableServiceAccount)
        $installScriptPayload = $installScriptPayload.replace("__PDCIPADDRESS__", $global:DomainControllerIpAddress)
        $installScriptPayload = $installScriptPayload.replace("__ROOTAUDITCSV__", $global:AppliedRootAuditCsv)
        $installScriptPayload = $installScriptPayload.replace("__CHANNELS__", "'" + ($global:Channels -join "','") + "'")
        If ($OldGpoId) {
            $installScriptPayload = $installScriptPayload.replace("__CLEANOLDGPO__", $True)
            $installScriptPayload = $installScriptPayload.replace("__OLDGPOID__", $OldGpoId)
        } Else {
            $installScriptPayload = $installScriptPayload.replace("__CLEANOLDGPO__", $False)
        }

        # Native Event Subscriber
        $NativeEventListenerExeGZippedBase64 = ""

        # Create and protect IOA folder and files
        $UTF8Only = New-Object System.Text.UTF8Encoding($false)
        $IoaFolderPath = $TemporaryFolderLocation + '{' + $BackupId + '}\DomainSysvol\GPO\Machine\IOA'
        Write-Information "[-] Checking IOA folder: $IoaFolderPath"
        If (!(Test-Path $IoaFolderPath)) {
            Write-Information "[-] Creating IOA folder: $IoaFolderPath"
            $null = New-Item -Path $IoaFolderPath -ItemType Directory -ErrorAction Stop
        }
        $TranscriptsFolderPath = $IoaFolderPath + '\transcripts'
        Write-Information "[-] Checking transcripts folder: $TranscriptsFolderPath"
        If (!(Test-Path $TranscriptsFolderPath)) {
            Write-Information "[-] Creating transcripts folder: $TranscriptsFolderPath"
            $null = New-Item -Path $TranscriptsFolderPath -ItemType Directory -ErrorAction Stop
        }

        # Generate events listener
        $NativeEventListenerExeGZipped = [System.Convert]::FromBase64String($NativeEventListenerExeGZippedBase64)
        $memoryStream = New-Object System.IO.MemoryStream
        $memoryStream.Write($NativeEventListenerExeGZipped, 0, $NativeEventListenerExeGZipped.Length)
        $memoryStream.Seek(0,0) | Out-Null
        $gzipStream = New-Object System.IO.Compression.GZipStream($memoryStream, [System.IO.Compression.CompressionMode]::Decompress)
        $streamReader = New-Object System.IO.StreamReader($gzipStream)
        $memoryStreamReader = New-Object System.IO.MemoryStream
        $streamReader.BaseStream.CopyTo($memoryStreamReader);

        $NativeEventListenerListenerExePath = $IoaFolderPath + '\Register-TenableADEventsListener.exe'
        Write-Information "[-] Creating Native Event Subscriber executable file at $NativeEventListenerListenerExePath"
        [System.IO.File]::WriteAllBytes($NativeEventListenerListenerExePath, $memoryStreamReader.ToArray())

        $memoryStream.Dispose()
        $gzipStream.Dispose()
        $streamReader.Dispose()
        $memoryStreamReader.Dispose()

        $IoaConfigurationFilePath = $IoaFolderPath + '\TenableADEventsListenerConfiguration.json'
        Write-Information "[-] Creating IOA configuration file at $IoaConfigurationFilePath"
        $global:IoaConfiguration | ConvertTo-Json -depth 2 | Set-Content -Path $IoaConfigurationFilePath

        # Create scheduled task to execute event listener script
        $TaskModifiedDate = (Get-Date).ToUniversalTime().ToString("yyyy-MM-dd HH:mm:ss")

        # Create the ScheduledTasks.xml
        $ImmediateTaskXml = '<ImmediateTaskV2 clsid="{9756B581-76EC-4169-9AFC-0CA8D43ADB5F}" name="TenableADTask___UID__" image="0" changed="__CHANGED__" uid="{__UID__}" userContext="0" removePolicy="0"><Properties action="C" name="TenableADTask___UID__" runAs="NT AUTHORITY\System" logonType="S4U"><Task version="1.3"><RegistrationInfo><Author>Tenable.ad</Author><Description>This scheduled task has been created as part of the deployment of Tenable.ad</Description></RegistrationInfo><Principals><Principal id="Author"><UserId>NT AUTHORITY\System</UserId><LogonType>S4U</LogonType><RunLevel>HighestAvailable</RunLevel></Principal></Principals><Settings><UseUnifiedSchedulingEngine>false</UseUnifiedSchedulingEngine><IdleSettings><Duration>PT1M</Duration><WaitTimeout>PT2H</WaitTimeout><StopOnIdleEnd>false</StopOnIdleEnd><RestartOnIdle>false</RestartOnIdle></IdleSettings><MultipleInstancesPolicy>IgnoreNew</MultipleInstancesPolicy><DisallowStartIfOnBatteries>false</DisallowStartIfOnBatteries><StopIfGoingOnBatteries>false</StopIfGoingOnBatteries><AllowHardTerminate>false</AllowHardTerminate><StartWhenAvailable>true</StartWhenAvailable><AllowStartOnDemand>false</AllowStartOnDemand><Enabled>true</Enabled><Hidden>false</Hidden><ExecutionTimeLimit>PT0S</ExecutionTimeLimit><Priority>7</Priority></Settings><Actions Context="Author"><Exec><Command>%SystemRoot%\system32\WindowsPowerShell\v1.0\powershell.exe</Command><Arguments>-NoProfile -NonInteractive -Command (Invoke-Command -ScriptBlock {__SCRIPT__})</Arguments></Exec></Actions><Triggers><RegistrationTrigger><Enabled>true</Enabled></RegistrationTrigger></Triggers></Task></Properties></ImmediateTaskV2>'
        $TaskXML = '<?xml version="1.0" encoding="utf-8"?><ScheduledTasks clsid="{CC63F200-7309-4ba0-B154-A71CD118DBCC}">' + $ImmediateTaskXml + '</ScheduledTasks>'

        $TaskXML = $TaskXML.replace("__CHANGED__", $TaskModifiedDate)
        $TaskXML = $TaskXML.replace("__UID__", $Newguid)
        $TaskXML = $TaskXML.replace("__SCRIPT__", $installScriptPayload)

        Write-Information "[-] Creating immediate scheduled task to register new event listener, changed at: $TaskModifiedDate, with uid $Newguid"
        $TaskXMLParentPath = $TemporaryFolderLocation + '{' + $BackupId + '}\DomainSysvol\GPO\Machine\Preferences\ScheduledTasks'
        Write-Information "[-] Checking custom temporary scheduled tasks folder existence: $TaskXMLParentPath"
        If (!(Test-Path $TaskXMLParentPath)) {
            Write-Information "[-] Creating custom temporary scheduled tasks folder: $TaskXMLParentPath"
            $null = New-Item -Path $TaskXMLParentPath -ItemType Directory -ErrorAction Stop
        }

        $TaskXMLPath = $TaskXMLParentPath + '\ScheduledTasks.xml'

        Write-Information "[-] Creating immediate task xml file at: $TaskXMLPath"
        [System.IO.File]::WriteAllLines($TaskXMLPath, $TaskXML, $UTF8Only)

        # Create the audit.csv folder
        $AuditCSVParentPath = $TemporaryFolderLocation + '{' + $BackupId + '}\DomainSysvol\GPO\Machine\Microsoft\Windows NT\Audit'
        Write-Information "[-] Checking audit csv folder: $AuditCSVParentPath"
        If (!(Test-Path $AuditCSVParentPath)) {
            Write-Information "[-] Creating audit csv folder: $AuditCSVParentPath"
            $null = New-Item -Path $AuditCSVParentPath -ItemType Directory -ErrorAction Stop
        }

        # Create the GptTmpl.inf
        # SCENoApplyLegacyAuditPolicy=1 makes the **advanced** audit policy (which we use) override the basic audit policy settings (cf. description in "Generate-AuditCsv")
        # It's the default but we enforce it to prevent unexpected settings
        $GptTmplInf = @"
[Unicode]
Unicode=yes
[Version]
signature="`$CHICAGO`$"
Revision=1
[Registry Values]
MACHINE\System\CurrentControlSet\Control\Lsa\SCENoApplyLegacyAuditPolicy=4,1
"@

        # If an IOA needs some registry value to be set, we add them to the GptTmpl.inf file.
        If ($null -ne $global:RegistryValuesToSet) {
            $GptTmplInf += "`r`n" + $global:RegistryValuesToSet
        }

        $GptTmplInfParentPath = $TemporaryFolderLocation + '{' + $BackupId + '}\DomainSysvol\GPO\Machine\Microsoft\Windows NT\SecEdit'
        Write-Information "[-] Checking gpttmpl folder: $GptTmplInfParentPath"
        If (!(Test-Path $GptTmplInfParentPath)) {
            Write-Information "[-] Creating gpttmpl folder: $GptTmplInfParentPath"
            $null = New-Item -Path $GptTmplInfParentPath -ItemType Directory -ErrorAction Stop
        }
        $GptTmplInfPath = $GptTmplInfParentPath + '\GptTmpl.inf'
        Write-Information "[-] Creating gpttmpl file at $GptTmplInfPath"
        [System.IO.File]::WriteAllLines($GptTmplInfPath, $GptTmplInf, $UTF8Only)

        $BackupXmlPath = $TemporaryFolderLocation + "{" + $BackupId + "}" + "\Backup.xml"
        $GpReportPath = $TemporaryFolderLocation + "{" + $BackupId + "}" + "\gpreport.xml"

        $RegistryPolXml = @"
<GroupPolicyExtension bkp:ID="{35378EAC-683F-11D2-A89A-00C04FBBCFA2}" bkp:DescName="Registry">
<FSObjectFile bkp:Path="%GPO_MACH_FSPATH%\registry.pol" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\registry.pol" bkp:Location="DomainSysvol\GPO\Machine\registry.pol"/>
</GroupPolicyExtension>
"@

        $BackupContent = @"
<?xml version="1.0" encoding="utf-8"?><!-- Copyright (c) Microsoft Corporation.  All rights reserved. --><GroupPolicyBackupScheme bkp:version="2.0" bkp:type="GroupPolicyBackupTemplate" xmlns:bkp="http://www.microsoft.com/GroupPolicy/GPOOperations" xmlns="http://www.microsoft.com/GroupPolicy/GPOOperations">
<GroupPolicyObject><SecurityGroups/><FilePaths/><GroupPolicyCoreSettings><ID><![CDATA[{__GPOID__}]]></ID><Domain></Domain><SecurityDescriptor>01 00 04 9c 00 00 00 00 00 00 00 00 00 00 00 00 14 00 00 00 04 00 ec 00 08 00 00 00 05 02 28 00 00 01 00 00 01 00 00 00 8f fd ac ed b3 ff d1 11 b4 1d 00 a0 c9 68 f9 39 01 01 00 00 00 00 00 05 0b 00 00 00 00 00 24 00 ff 00 0f 00 01 05 00 00 00 00 00 05 15 00 00 00 a7 88 56 9c ab c3 34 78 fe ad f0 38 00 02 00 00 00 02 24 00 ff 00 0f 00 01 05 00 00 00 00 00 05 15 00 00 00 a7 88 56 9c ab c3 34 78 fe ad f0 38 00 02 00 00 00 02 24 00 ff 00 0f 00 01 05 00 00 00 00 00 05 15 00 00 00 a7 88 56 9c ab c3 34 78 fe ad f0 38 07 02 00 00 00 02 14 00 94 00 02 00 01 01 00 00 00 00 00 05 09 00 00 00 00 02 14 00 94 00 02 00 01 01 00 00 00 00 00 05 0b 00 00 00 00 02 14 00 ff 00 0f 00 01 01 00 00 00 00 00 05 12 00 00 00 00 0a 14 00 ff 00 0f 00 01 01 00 00 00 00 00 03 00 00 00 00</SecurityDescriptor><DisplayName/><Options><![CDATA[0]]></Options><UserVersionNumber><![CDATA[0]]></UserVersionNumber><MachineVersionNumber><![CDATA[131074]]></MachineVersionNumber><MachineExtensionGuids><![CDATA[[{00000000-0000-0000-0000-000000000000}{CAB54552-DEEA-4691-817E-ED4A4D1AFC72}][{35378EAC-683F-11D2-A89A-00C04FBBCFA2}{D02B1F72-3407-48AE-BA88-E8213C6761F1}][{827D319E-6EAC-11D2-A4EA-00C04F79F83A}{803E14A0-B4FB-11D0-A0D0-00A0C90F574B}][{AADCED64-746C-4633-A97C-D61349046527}{CAB54552-DEEA-4691-817E-ED4A4D1AFC72}][{F3CCC681-B74C-4060-9F26-CD84525DCA2A}{0F3F3735-573D-9804-99E4-AB2A69BA5FD4}]]]></MachineExtensionGuids><UserExtensionGuids/><WMIFilter/></GroupPolicyCoreSettings>
__REGISTRYPOL__<GroupPolicyExtension bkp:ID="{827D319E-6EAC-11D2-A4EA-00C04F79F83A}" bkp:DescName="Security">
<FSObjectFile bkp:Path="%GPO_MACH_FSPATH%\Microsoft\Windows NT\SecEdit\GptTmpl.inf" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Microsoft\Windows NT\SecEdit\GptTmpl.inf" bkp:ReEvaluateFunction="SecurityValidateSettings" bkp:Location="DomainSysvol\GPO\Machine\Microsoft\Windows NT\SecEdit\GptTmpl.inf"/>
</GroupPolicyExtension>
<GroupPolicyExtension bkp:ID="{F15C46CD-82A0-4C2D-A210-5D0D3182A418}" bkp:DescName="Unknown Extension">
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Microsoft" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Microsoft" bkp:Location="DomainSysvol\GPO\Machine\Microsoft"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Microsoft\Windows NT" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Microsoft\Windows NT" bkp:Location="DomainSysvol\GPO\Machine\Microsoft\Windows NT"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Microsoft\Windows NT\Audit" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Microsoft\Windows NT\Audit" bkp:Location="DomainSysvol\GPO\Machine\Microsoft\Windows NT\Audit"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Microsoft\Windows NT\SecEdit" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Microsoft\Windows NT\SecEdit" bkp:Location="DomainSysvol\GPO\Machine\Microsoft\Windows NT\SecEdit"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\IOA" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\IOA" bkp:Location="DomainSysvol\GPO\Machine\IOA"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\IOA\transcripts" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\IOA\transcripts" bkp:Location="DomainSysvol\GPO\Machine\IOA\transcripts"/>
<FSObjectFile bkp:Path="%GPO_MACH_FSPATH%\IOA\Register-TenableADEventsListener.exe" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\IOA\Register-TenableADEventsListener.exe" bkp:Location="DomainSysvol\GPO\Machine\IOA\Register-TenableADEventsListener.exe"/>
<FSObjectFile bkp:Path="%GPO_MACH_FSPATH%\IOA\TenableADEventsListenerConfiguration.json" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\IOA\TenableADEventsListenerConfiguration.json" bkp:Location="DomainSysvol\GPO\Machine\IOA\TenableADEventsListenerConfiguration.json"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Preferences" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Preferences" bkp:Location="DomainSysvol\GPO\Machine\Preferences"/>
<FSObjectDir bkp:Path="%GPO_MACH_FSPATH%\Preferences\ScheduledTasks" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Preferences\ScheduledTasks" bkp:Location="DomainSysvol\GPO\Machine\Preferences\ScheduledTasks"/>
<FSObjectFile bkp:Path="%GPO_MACH_FSPATH%\Preferences\ScheduledTasks\ScheduledTasks.xml" bkp:SourceExpandedPath="\\' + `$global:DomainControllerDNSName + '\sysvol\' + `$global:DomainName + '\Policies\{__GPOID__}\Machine\Preferences\ScheduledTasks\ScheduledTasks.xml" bkp:Location="DomainSysvol\GPO\Machine\Preferences\ScheduledTasks\ScheduledTasks.xml"/>
</GroupPolicyExtension>
</GroupPolicyObject>
</GroupPolicyBackupScheme>
"@

        # Generate only for attacks which need it
        If ($global:Attacks.ContainsKey("11")) {
            $BackupContent = $BackupContent.replace("__REGISTRYPOL__", $RegistryPolXml)
        } Else {
            $BackupContent = $BackupContent.replace("__REGISTRYPOL__", "")
        }

        Write-Information "[-] Customizing GPO backup with scheduled task, audit policies file and gpttmpl files"
        $BackupContent = $BackupContent.replace("__GPOID__", $GpoId)
        $BackupContent | Set-Content -Encoding ASCII -Path $BackupXmlPath -ErrorAction Stop
        Write-Information "[-] GPO custom backup set up"

        Write-Information "[-] Checking GPO report file existence: $GpReportPath"
        If (!(Test-Path $GpReportPath)) {
            Write-Information "[-] Getting GPO report file: $GpReportPath"
            Get-GPOReport -Name $GPODisplayName -Domain $global:DomainName -Server $global:DomainControllerIpAddress -ReportType XML -Path $GpReportPath -ErrorAction SilentlyContinue
        }

        # Manage case when DFSR replication interfere (https://docs.microsoft.com/en-us/troubleshoot/windows-server/group-policy/directory-is-not-empty)
        # Try to import 10 times
        For ($i = 1; $i -le 10; $i++) {

            If ($i -gt 1) {
                $retryDelay = $i * 2
                Write-Host "Importing GPO failed, try ($i/10) in $retryDelay seconds"
                Start-Sleep -Seconds $retryDelay
            }

            # Import back GPO
            try {
                Write-Information "[-] Importing GPO: $GPODisplayName"
                $ImportedGpo = Import-GPO -BackupId $BackupId -Domain $global:DomainName -Server $global:DomainControllerDNSName -TargetName $GPODisplayName -Path (Resolve-Path $TemporaryFolderLocation).Path -ErrorAction Stop

                If ($Null -ne $ImportedGpo) {
                    break
                }
            } catch {
                Write-Error $_.Exception
            }
        }

        If ($Null -eq $ImportedGpo) {
            throw "Importing GPO '$GPODisplayName' failed: replication process may be on progress, try again later"
        }

        # If specific DCs are targeted
        If ($Target) {
            Write-Information "[-] Setting permission for GPO $GPODisplayName to Authenticated Users in domain $global:DomainName"
            $AuthenticatedUsersSid = New-Object System.Security.Principal.SecurityIdentifier ("S-1-5-11")
            $AuthenticatedUsers = $AuthenticatedUsersSid.Translate([System.Security.Principal.NTAccount])
            $AuthenticatedUsersTarget = $AuthenticatedUsers.Value.ToString()
            # Remove GPO apply to Authenticated Users (from Security group filtering) and apply only to target computers
            Set-GPPermissions -Name $GPODisplayName -TargetName $AuthenticatedUsersTarget -TargetType Group -DomainName $global:DomainName -Server $global:DomainControllerIpAddress -PermissionLevel GpoRead -Replace -ErrorAction Stop | Out-Null
            foreach ($DomainController in $Target) {
                try {
                    $SanitizedDomainController = $DomainController.Replace(".$global:DomainName", "")
                    Write-Information "[-] Setting permission for GPO $GPODisplayName to $SanitizedDomainController in domain $global:DomainName"
                    Set-GPPermissions -Name $GPODisplayName -TargetName $SanitizedDomainController -TargetType Computer -DomainName $global:DomainName -Server $global:DomainControllerIpAddress -PermissionLevel GpoApply -Replace -ErrorAction Stop | Out-Null
                } catch {
                    throw "The domain controller '$DomainController' is unknown."
                }
            }
        }

        # Link the GPO to the DC organizational unit, set it as Enforced for higher priority and to avoid potential inheritance blocking
        Write-Information "[-] Linking GPO $GPODisplayName to $global:DomainControllerOU_DN in domain $global:DomainName on domain controller $global:DomainControllerDNSName"
        Remove-GPLink -Name $GPODisplayName -Target $global:DomainControllerOU_DN -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue | Out-Null
        try {
            New-GPLink -Name $GPODisplayName -Target $global:DomainControllerOU_DN -Domain $global:DomainName -Server $global:DomainControllerDNSName -Enforced Yes -ErrorAction Stop | Out-Null
        } catch [System.UnauthorizedAccessException] {
            Write-Error "[!] Could not link the GPO, please run this script under a domain account with permissions to (create a GPO and) link it to the Domain Controllers OU." -ErrorAction Stop
        }

        Write-Host "`n[+] All done."
        Write-Host "[+] GPO $GpoId successfully linked to $global:DomainName"
        Write-Host "[+] Tenable.ad Attack Detection Module successfully deployed. Congratulations!`n"
    } catch {
        Write-Error $_.Exception
        Write-Host "Rolling back changes"
        Clean
    } finally {
        # Cleaning
        Remove-Item -Recurse -Force $TemporaryFolderLocation -ErrorAction SilentlyContinue | Out-Null
        Write-Information "[-] Removing temporary folder: $TemporaryFolderLocation`n"
    }
}

function Check-ExistingGpos {

    Write-Host "[-] Checking whether IOA script is runnable."
    $scriptRunType = "Uninstall"

    If (-Not $Uninstall) {
        $scriptRunType = "Install"

        $installedGpoNames = @($GPODisplayName, "Tenable for AD", "Alsid for AD")
        $installedGpos = @{ $installedGpoNames[0] = $global:GPODescription; $installedGpoNames[1] = "This GPO has been created as part of the deployment of Tenable for Active Directory"; $installedGpoNames[2] = "This GPO has been created as part of the deployment of Alsid for Active Directory" }

        foreach ($currentGpoName in $installedGpoNames) {
            $currentGpoDescription = $installedGpos.$currentGpoName

            # Successive installs check
            Write-Information "[-] Trying to get existing GPO: $currentGpoName"
            $existingGpo = Get-GPO -Name $currentGpoName -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue
            If ($Null -eq $existingGpo) {
                # Try finding it by description instead
                $existingGpo = Get-GPO -All -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue | Where-Object { $_.Description -eq $currentGpoDescription } | Select-Object -First 1
            }
            If ($Null -ne $existingGpo) {
                $existingGpoDisplayName = $existingGpo.DisplayName
                Write-Host "[-] Aborting install script: GPO $existingGpoDisplayName exists and successive installs runs are forbidden, please uninstall it first before starting over the deployment."
                throw "Install script abortion"
            }
        }
    }

    $installedCleaningGpoNames = @($CleaningGPODisplayName, "Tenable for AD cleaning", "Alsid for AD cleaning")
    $installedCleaningGpos = @{ $installedCleaningGpoNames[0] = $global:CleaningGPODescription; $installedCleaningGpoNames[1] = "This GPO has been created as part of the cleaning of Tenable for Active Directory"; $installedCleaningGpoNames[2] = "This GPO has been created as part of the cleaning of Alsid for Active Directory" }

    foreach ($currentCleaningGpoName in $installedCleaningGpoNames) {
        $currentCleaningGpoDescription = $installedCleaningGpos.$currentCleaningGpoName

        # Install/Uninstall at least 4 hours after uninstall
        Write-Information "[-] Trying to get existing cleaning GPO: $currentCleaningGpoName"
        $existingCleaningGpo = Get-GPO -Name $currentCleaningGpoName -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue
        If ($Null -eq $existingCleaningGpo) {
            # Try finding it by description instead
            $existingCleaningGpo = Get-GPO -All -Domain $global:DomainName -Server $global:DomainControllerDNSName -ErrorAction SilentlyContinue | Where-Object { $_.Description -eq $currentCleaningGpoDescription } | Select-Object -First 1
        }
        If ($Null -ne $existingCleaningGpo) {
            $existingCleaningGpoDisplayName = $existingCleaningGpo.DisplayName
            $cleaningGpoCreationDate = $existingCleaningGpo.CreationTime
            $recommendedInstallDate = $cleaningGpoCreationDate.AddHours(4)

            If ((Get-Date) -lt $recommendedInstallDate) {
                Write-Host "[-] Aborting $scriptRunType script: cleaning GPO $existingCleaningGpoDisplayName exists and was created less than 4 hours ago ($cleaningGpoCreationDate), please wait until $recommendedInstallDate, delete it manually and finally, run the $scriptRunType script again."
            } Else {
                Write-Host "[-] Aborting $scriptRunType script: cleaning GPO $existingCleaningGpoDisplayName exists and was created more than 4 hours ago ($cleaningGpoCreationDate), please delete it manually then run the $scriptRunType script again."
            }

            throw "$scriptRunType script abortion"
        }
    }
}

function Check-Prerequisites {

    Write-Host "    ######################################################`n    #    Tenable.ad Attack Detection Module Installer    #`n    ######################################################`n"

    # Validate the technical pre-requisites and retrieve AD's information

    If (Get-Module -ListAvailable -Name "ActiveDirectory") {
        Write-Information "[-] Importing module ActiveDirectory"
        Import-Module ActiveDirectory -WarningAction SilentlyContinue
    } Else {
        Write-Error "`n[!] This installer requires PowerShell's ActiveDirectory module. Please install it before running this tool.`nExiting now..."
        throw "Checking prerequisites failed"
    }

    If (Get-Module -ListAvailable -Name "GroupPolicy") {
        Write-Information "[-] Importing module GroupPolicy"
        Import-Module GroupPolicy -WarningAction SilentlyContinue
    } Else {
        Write-Error "`n[!] This installer requires PowerShell's GroupPolicy module. Please install it before running this tool.`nExiting now..."
        throw "Checking prerequisites failed"
    }

    If ((Get-WmiObject -Class Win32_ComputerSystem).PartOfDomain) {
        Write-Host "[-] Local computer part of an Active Directory domain. Proceeding with discovery tests..."
    } Else {
        Write-Host "[-] Local computer NOT part of an Active Directory."
        Write-Error "`n[!] This installer cannot be run by a machine from outside a domain mainly because ActiveDirectory module (specifically Import-GPO) does not support explicit authentication."
        throw "Checking prerequisites failed"
    }

    # Ensure alias Set-GPPermissions is set for Set-GPPermission(called Set-GPPermissions on earlier CLR versions: 2 and lower)
    try {
        $existingGPPermissionCommand = Get-Command Set-GPPermissions
        If ($Null -eq $existingGPPermissionCommand) {
            throw "Set-GPPermissions command does not exist"
        }
    } catch {
        try {
            $existingGPPermissionAlias = Get-Alias Set-GPPermissions
            If ($Null -eq $existingGPPermissionAlias) {
                throw "Set-GPPermissions alias does not exist"
            }
        } catch {
            Set-Alias Set-GPPermissions Set-GPPermission
        }
        Write-Host "[-] Alias set Set-GPPermissions for Set-GPPermission."
    }

    # Check service account validity, not needed for uninstall
    If (-Not $Uninstall) {
        $domain = $null
        $user = $null
        $splitArray = $null
        If ([Regex]::Matches($TenableServiceAccount, "\\").Count -eq 1) {
            $splitArray = $TenableServiceAccount.Split("\")
            $domain = $splitArray[0]
            $user = $splitArray[1]
        } ElseIf ([Regex]::Matches($TenableServiceAccount, "@").Count -eq 1) {
            $splitArray = $TenableServiceAccount.Split("@")
            $domain = $splitArray[1]
            $user = $splitArray[0]
        } Else {
            $user = $TenableServiceAccount
        }

        try {
            If ($domain) {
                Write-Information "[-] Checking service account $user existence in domain $domain"
                $Null = Get-ADUser $user -Server $domain
            } Else {
                Write-Information "[-] Checking service account $user existence in local domain"
                $Null = Get-ADUser $user
            }
        } catch {
            Write-Error $_.Exception
            throw "Service account does not exist, please use a valid service account."
        }
    }

    # Fetch domain controller name if not filled
    If ($DomainControllerAddress -eq "") {
        Write-Information "[-] Requesting domain controller IP address as it was not passed as parameter"
        $global:DomainControllerIpAddress = (Get-ADDomainController).IPv4Address
    } Else {
        $global:DomainControllerIpAddress = $DomainControllerAddress
    }

    # Retrieve the domain's information - if needed
    If ($global:DomainControllerIpAddress) {
        Write-Information "[-] Requesting domain from domain controller $global:DomainControllerIpAddress"
        $DomainData = Get-ADDomain -Server $global:DomainControllerIpAddress -ErrorAction Stop
    } Else {
        Write-Information "[-] Requesting domain from local computer"
        $DomainData = Get-ADDomain -Current LocalComputer -ErrorAction Stop
    }

    $global:DomainName = $DomainData.DNSRoot
    $global:DomainControllerDNSName = $DomainData.PDCEmulator

    If ($DomainControllerOU -ne "") {
        $global:DomainControllerOU_DN = $DomainControllerOU
    } Else {
        $global:DomainControllerOU_DN = $DomainData.DomainControllersContainer
    }
    Write-Information "[-] Setting domain controllers organizational unit to $global:DomainControllerOU_DN"

    Write-Host "[-] Targeted domain name: $global:DomainName"
    Write-Host "[-] Domain Controller owning the deployment: $global:DomainControllerDNSName"
    Write-Host "[-] Container where the GPO will be linked to: $global:DomainControllerOU_DN`n"
}

