1":{"Events":[{"Id":8222,"ProviderName":"VSSAudit"},{"Id":4688,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":4689,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":5857,"ProviderName":"Microsoft-Windows-WMI-Activity"},{"Id":325,"ProviderName":"ESENT"},{"Id":5145,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":4674,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":4624,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":4634,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":12,"ProviderName":"Microsoft-Windows-Kernel-General"}],"Audit":[",System,Audit Application Generated,{0CCE9222-69AE-11D9-BED3-505054503030},Success,,1",",System,Audit Process Creation,{0CCE922B-69AE-11D9-BED3-505054503030},Success,,1",",System,Audit Process Termination,{0CCE922C-69AE-11D9-BED3-505054503030},Success,,1",",System,Audit Detailed File Share,{0CCE9244-69AE-11D9-BED3-505054503030},Success,,1",",System,Audit Sensitive Privilege Use,{0CCE9228-69AE-11D9-BED3-505054503030},Success and Failure,,3",",System,Audit Logon,{0CCE9215-69AE-11D9-BED3-505054503030},Success,,1",",System,Audit Logoff,{0CCE9216-69AE-11D9-BED3-505054503030},Success,,1"],"Channels":["Microsoft-Windows-WMI-Activity/Operational"],"RegistryValues":[],"PolRegistryValues":["HKEY_LOCAL_MACHINE\\SOFTWARE\\Microsoft\\Windows\\CurrentVersion\\Policies\\System\\Audit\\ProcessCreationIncludeCmdLine_Enabled=4,1"]},"12":{"Events":[{"Id":4768,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":4624,"ProviderName":"Microsoft-Windows-Security-Auditing"}],"Audit":[",System,Audit Kerberos Authentication Service,{0cce9242-69ae-11d9-bed3-505054503030},Success,,1",",System,Audit Logon,{0cce9215-69ae-11d9-bed3-505054503030},Success,,1"],"Channels":[],"RegistryValues":[],"PolRegistryValues":[]},"13":{"Events":[{"Id":4662,"ProviderName":"Microsoft-Windows-Security-Auditing"},{"Id":4624,"ProviderName":"Microsoft-Windows-Security-Auditing"}],"Audit":[",System,Audit Other Object Access Events,{0cce9227-69ae-11d9-bed3-505054503030},Success,,1",",System,Audit Logon,{0cce9215-69ae-11d9-bed3-505054503030},Success,,1"],"Channels":[],"RegistryValues":[],"PolRegistryValues":[]},"14":{"Events":[{"Id":541,"ProviderName":"Microsoft-Windows-DNSServer"},{"Id":4624,"ProviderName":"Microsoft-Windows-Security-Auditing"}],"Audit":[",System,Audit Logon,{0cce9215-69ae-11d9-bed3-505054503030},Success,,1"],"Channels":["Microsoft-Windows-DNSServer/Audit"],"RegistryValues":[],"PolRegistryValues":[]}}}'
    $domainsAttacksConfiguration = $domainsAttacksConfigurationJson | ConvertFrom-Json

    $dcDnsNameKey = $global:DomainName
    If ($Null -eq $domainsAttacksConfiguration.$dcDnsNameKey) {
        Write-Error "Targeted domain $dcDnsNameKey was not set in IOA configuration, you may have insufficient rights, please contact your global administrator"
        throw "Targeted domain not set in IOA configuration"
    }

    Write-Host "[-] Targeted domain $dcDnsNameKey was set in IOA configuration"
    $appliedDomainConfiguration = $domainsAttacksConfiguration.$dcDnsNameKey

    $eventsHash = @{}
    $auditHash = @{}
    $attacksHash = @{}
    $channelHash = @{}
    $finalAuditHash = @{}
    $registryValuesHash = @{}
    $polRegistryValuesHash = @{}
    foreach ($attack in $appliedDomainConfiguration.PsObject.Properties) {
        $attackConfigJson = ConvertTo-Json($attack.Value) -Compress
        $attacksHash.Add($attack.Name, $null)
        Write-Information "[-] Reading attack configuration with id $($attack.Name): $attackConfigJson"
        $eventsConfiguration = $attack.Value.Events
        foreach ($ev in $eventsConfiguration) {
            $p = [System.Tuple]::Create($ev.Id, $ev.ProviderName)
            if (-Not $eventsHash.ContainsKey($p)) {
                $eventsHash.Add($p, $null)
            }
        }

        $auditConfiguration = $attack.Value.Audit
        foreach ($au in $auditConfiguration) {
            $splitAudit = $au -split ","
            If (-Not $auditHash.ContainsKey($au)) {
                $auditHash.Add($au, $splitAudit[2])
            }
        }

        $channelsConfiguration = $attack.Value.Channels
        foreach ($channel in $channelsConfiguration) {
            If (-Not $channelHash.ContainsKey($channel)) {
                $channelHash.Add($channel, $null)
            }
        }

        $registryValuesConfiguration = $attack.Value.registryValues
        foreach ($registryValue in $registryValuesConfiguration) {
            If (-Not $registryValuesHash.ContainsKey($registryValue)) {
                $registryValuesHash.Add($registryValue, $null)
            }
        }

        $polRegistryValuesConfiguration = $attack.Value.polRegistryValues
        foreach ($polRegistryValue in $polRegistryValuesConfiguration) {
            If (-Not $polRegistryValuesHash.ContainsKey($polRegistryValue)) {
                $polRegistryValuesHash.Add($polRegistryValue, $null)
            }
        }
    }

    # Audit policies success and failure handling
    $groupedAuditPolicies = $auditHash.GetEnumerator() | Select-Object Name, Value | Group-Object -Property Value
    foreach ($groupAudit in $groupedAuditPolicies) {
        If ($groupAudit.Count -eq 1) {
            $finalAuditHash.Add($groupAudit.Group[0].Name, $null)
        } Else {
            $tempList = [System.Collections.ArrayList]@()
            $successAndFailureList = [System.Collections.ArrayList]@()
            foreach ($g in $groupAudit.Group) {
                $splitGroupAudit = $g.Name -split ","
                If ($splitGroupAudit[$splitGroupAudit.Length - 1] -eq 3) {
                    $Null = $successAndFailureList.Add($g.Name)
                    break
                } Else {
                    $Null = $tempList.Add($g.Name)
                }
            }

            If ($successAndFailureList.Count -eq 0) {
                If ($tempList.Count -eq 2) {
                    $successAndFailureCustom = $tempList[0] -split ","
                    $successAndFailureCustom[4] = "Success and Failure"
                    $successAndFailureCustom[6] = 3
                    $finalAuditHash.Add($successAndFailureCustom, $null)
                } Else {
                    $finalAuditHash.Add($tempList[0], $null)
                }
            } Else {
                $finalAuditHash.Add($successAndFailureList[0], $null)
            }
        }
    }

    # IoA Configuration that will be saved as json
    $global:IoaConfiguration = @{
        Events            = $eventsHash.Keys | ForEach-Object { @{ Id = $_.Item1; ProviderName = $_.Item2 } }
        Audit             = $finalAuditHash.Keys
        Channels          = $channelHash.Keys
        RegistryValues    = $registryValuesHash.Keys
        PolRegistryValues = $polRegistryValuesHash.Keys
    }

    $global:AppliedRootAuditCsv = $finalAuditHash.Keys -join "`r`n"
    $global:Attacks = $attacksHash
    $global:Channels = $channelHash.Keys
    If ($registryValuesHash.Count -gt 0) {
        $global:RegistryValuesToSet = $registryValuesHash.Keys -join "`r`n"
    }
    $global:PolRegistryValuesToSet = $polRegistryValuesHash.Keys
    Write-Information "[-] Applied event filters:"
    $joinedEventsFilters = $eventsHash.Keys -join ", "
    Write-Information $joinedEventsFilters
    Write-Information "[-] Applied root audit policies:"
    Write-Information $global:AppliedRootAuditCsv
    If ($global:Channels.Count -gt 0) {
        Write-Information "[-] Channels:"
        $joinedChannels = $global:Channels -join "`r`n"
        Write-Information $joinedChannels
    }
    If ($global:Attacks.Count -gt 0) {
        Write-Information "[-] Attacks:"
        $joinedAttacks = $global:Attacks.Keys -join "; "
        Write-Information $joinedAttacks
    }
    If ($null -ne $global:RegistryValuesToSet) {
        Write-Information "[-] GptTmpl registry values:"
        Write-Information $global:RegistryValuesToSet
	}
    If ($global:PolRegistryValuesToSet.Count -gt 0) {
        Write-Information "[-] POL registry values:"
        $joinedPolRegistryValues = $global:PolRegistryValuesToSet -join "`r`n"
        Write-Information $joinedPolRegistryValues
    }
}

function Clean {
    Write-Information "[-] Installing cleaning GPO for removing event listener and WMI active script consumers"
    Uninstall-ByGpo
    Write-Information "[-] Force gpupdate`n"
    Invoke-Command -ScriptBlock { gpupdate /force }
    Write-Information "[-] Deleting GPO $GPODisplayName"
    $Null = Delete-GPO -GpoName $GPODisplayName -GpoDescription $global:GPODescription
}

try {
    $LogGuid = [guid]::NewGuid()
    $Logfile = $MyInvocation.MyCommand.Path -replace "\.ps1$", "-$LogGuid.log"

    Start-Transcript -Path $Logfile -IncludeInvocationHeader
    Write-Information "[-] Starting script version v3.29.3, occurrence 1"

    Check-Prerequisites
    Check-ExistingGpos

    If ($Uninstall) {
        Write-Information "[-] Starting uninstall script"
        # Delete Alsid for AD Gpos: to remove later when releasing 3.0
        $Null = Delete-GPO -GpoName 'Alsid for AD' -GpoDescription 'This GPO has been created as part of the deployment of Alsid for Active Directory'
        $Null = Delete-GPO -GpoName 'Alsid for AD cleaning' -GpoDescription 'This GPO has been created as part of the cleaning of Alsid for Active Directory'
        $Null = Delete-GPO -GpoName 'Tenable for AD' -GpoDescription 'This GPO has been created as part of the deployment of Tenable for Active Directory'
        $Null = Delete-GPO -GpoName 'Tenable for AD cleaning' -GpoDescription 'This GPO has been created as part of the cleaning of Tenable for Active Directory'
        Clean
    } Else {
        Write-Information "[-] Applying IOA configuration setup"
        Check-IOASetup
        Write-Information "[-] Deleting existing GPO"
        $oldGpoId = Delete-GPO -GpoName $GPODisplayName -GpoDescription $global:GPODescription
        Write-Information "[-] Existing GPO $oldGpoId deleted"
        $Null = Delete-GPO -GpoName $CleaningGPODisplayName -GpoDescription $global:CleaningGPODescription
        Write-Information "[-] Starting install script"
        If ($Null -eq $oldGpoId) {
            New-GPOScheduledTask
        } Else {
            New-GPOScheduledTask -OldGpoId $oldGpoId
        }
        Write-Information "[-] Force gpupdate`n"
        Invoke-Command -ScriptBlock { gpupdate /force }
    }
} catch {
    Write-Error $_.Exception
} finally {
    Write-Information "`n"
    Stop-Transcript
}
